Regelungen für Beschädigung oder Verlust des Mietgegenstandes
(„Rental Protection Plan“)

Zwischen dem Mieter und der Firma Boels Rental Germany GmbH als Vermieter wurde der unmittelbar abgedeckte Mietvertrag geschlossen. Dem Mietvertrag liegen die Allgemeinen Mietbedingungen der Boels Rental Germany GmbH zu Grunde. Sie wurden dem Mieter beim Abschluss des Vertrages überreicht. Auf Wunsch wird dem Mieter ein weiteres Exemplar zugeschickt. Die Mietbedingungen sind auch auf der Website unter www.boels.com einzusehen und stehen dort als Download zur Verfügung.

Gemäß den Allgemeinen Mietbedingungen haftet der Mieter während der Dauer des Mietvertrages an dem Mietgegenstand einschließlich Mietgegenständen und -zubehör. Der Mieter kann im Rahmen der nachfolgenden Regelungen eine Haftungsbegrenzung (A/B) in Anspruch nehmen.

Nicht gedeckte Schäden sind vom Mieter zu tragen. In solchen Situationen bleiben die Allgemeinen Mietbedingungen der Boels Rental Germany GmbH unverändert gültig.

I. ALLGEMEINE BEDINGUNGEN ZUR HAFTUNGSBEGRENZUNG A UND HAFTUNGSBEGRENZUNG B

I.1. Vermieter
Dort im Text von „Vermieter“ oder von „Boels Rental Germany GmbH“ die Rede ist, ist dies „Boels Rental Germany GmbH“ oder zugehörige Unternehmen gemeint.

I.2. Deckungsgebiet
Die HAFTUNGSBEGRENZUNG A und die HAFTUNGSBEGRENZUNG B bieten Deckung für Schadensfälle in Deutschland, der Schweiz, Österreich und den Benelux-Ländern.

I.3. Verpflichtungen im Schadensfall
Der Mieter hat bei Eintritt eines Schadensfalles seine Verpflichtungen gemäß den Allgemeinen Mietbedingungen zu erfüllen, insbesondere ist er verpflichtet:

I.3.1. den Schaden dem Vermieter unverzüglich schriftlich, darüber hinaus auch möglichst mit fernmündlich oder fernschriftlich anzuzeigen;

I.3.2. Schäden durch Einbruchdiebstahl oder Raub unverzüglich der zuständigen Polizeidienststelle anzuzeigen und seine Untersuchung über Ursache, Hergang und Höhe des Schadens zu gestatten, wozu hierzu dienliche Auskunft – bei Verlangen schriftlich – zu erteilen und die erforderlichen Belege beizubringen, das Schadensbild zu beschreiben und die erforderlichen Maßnahmen zu ergreifen;

I.3.3. den Schaden nach Möglichkeit abzuwenden oder zu mindern;

I.3.4. auch sonst an der Abwicklung des Schadensfalles umfassend mitzuwirken und alles zu unterlassen, was den Interessen des Vermieters schaden könnte. Hierzu gehört insbesondere, dem Vermieter auf diesen Verlangen im Rahmen des Zumutbaren seine Untersuchung über Ursache, Hergang und Höhe des Schadens zu gestatten, wozu hierzu dienliche Auskunft – bei Verlangen schriftlich – zu erteilen und die erforderlichen Belege beizubringen, das Schadensbild zu beschreiben und die erforderlichen Maßnahmen zu ergreifen;

